INSERT INTO public.steps (image,step_number,step_description,recipe_id) VALUES
	 (NULL,0,'2 Oranges, An Egg,  Milk 120ml, Sugar 5g',2),
	 ('data:image/jpeg;base64,',1,'Prepare two good-looking oranges (preferably thin skin easier to cook)',2),
	 ('data:image/jpeg;base64,',2,'Cut the cap and carefully scoop out the flesh of the fruit',2),
	 ('data:image/jpeg;base64,',3,'Prepare 120ml of pure milk and one egg',2),
	 ('data:image/jpeg;base64,',4,'Beat the egg until small bubbles, plus pure milk and sugar stir. Note that the pure milk does not have to add too much, like a little sweeter can add more sugar',2),
	 ('data:image/jpeg;base64,',5,'Pour the stirred liquid into the hollowed out orange, do not pour too full oh ~',2),
	 ('data:image/jpeg;base64,',6,'Put on the steamer, cover the pot, boil water and steam for 8-12 minutes, there will be some egg mixture overflow, the junction can be fixed with a toothpick, the bottom of the orange will collapse, available bracket to vacate the orange stand',2),
	 ('data:image/jpeg;base64,:image/jpeg;base64,',7,'Finished!',2),
	 ('data:image/jpeg;base64,',0,'Buttered crust: medium gluten flour 90g, Fine granulated sugar 12g, Water 36g, Lard 32g, Shortening: Lard 36g, Red currant powder 2g, Red bean paste filling 200g, Egg yolk 5g, White sesame seeds 3g, White sesame seeds 3g',3),
	 ('data:image/jpeg;base64,',1,'Prepare all the ingredients.',3);
INSERT INTO public.steps (image,step_number,step_description,recipe_id) VALUES
	 ('data:image/jpeg;base64,',2,'Put all the ingredients for the water and oil crust into the barrel of a chef''s machine and knead into a smooth dough.',3),
	 ('data:image/jpeg;base64,',3,'Knead into a smooth dough.',3),
	 ('data:image/jpeg;base64,',4,'Mix the shortening ingredients into a dough.',3),
	 ('data:image/jpeg;base64,',5,'Wrap the shortening and the grease crust separately with plastic wrap and relax for 30 minutes.',3),
	 ('data:image/jpeg;base64,',6,'Cut the puff pastry into 8 small portions and cover with plastic wrap to prevent air drying.',3),
	 ('data:image/jpeg;base64,',7,'Roll out the dough into a thin sheet and wrap it around the shortening dough.',3),
	 ('data:image/jpeg;base64,',8,'Knead the dough tightly and place it face down.',3),
	 ('data:image/jpeg;base64,',9,'Roll it from top to bottom, cover with plastic wrap and let it relax for 20 minutes.',3),
	 ('data:image/jpeg;base64,',10,'Cover with plastic wrap and relax for 20 minutes.',3),
	 ('data:image/jpeg;base64,',11,'For the second roll, take a small piece of puff pastry dough, lightly press it, roll it into a cow tongue shape, and roll it from top to bottom.',3);
INSERT INTO public.steps (image,step_number,step_description,recipe_id) VALUES
	 ('data:image/jpeg;base64,',12,'Cover with plastic wrap and let it relax for 20 minutes.',3),
	 ('data:image/jpeg;base64,',13,'Divide the red bean paste filling into 8 portions, one 25g, and roll out.',3),
	 ('data:image/jpeg;base64,',14,'Take a small portion of puff pastry, press the middle finger down from the middle, and roll both sides towards the middle.',3),
	 ('data:image/jpeg;base64,',15,'Roll it into a round sheet and wrap it with bean paste filling.',3),
	 ('data:image/jpeg;base64,',16,'Press into a round cake with a diameter of 3 cm, find the center point and cut out 5 petals with a small knife.',3),
	 ('data:image/jpeg;base64,',17,'Pinch the thumb and forefinger into the shape of peach petals, press out the core in the middle and garnish with egg yolk and white sesame seeds.',3),
	 ('data:image/jpeg;base64,',18,'Place in preheated oven, upper and lower heat 180 degrees, 25-28 minutes.',3),
	 ('data:image/jpeg;base64,',19,'Finished!',3);
